using System;\nusing System.Collections.Generic;\nusing System.Text;\nusing System.Web.UI;\n\npublic partial class YourPage : Page\n{\n    protected void Page_Load(object sender, EventArgs e)\n    {\n        // Sample data collection\n        var items = new List<string> { "Item1", "Item2", "Item3" };\n\n        // Generate HTML content\n        string htmlContent = GenerateHtml(items);\n\n        // Assign the generated HTML to a placeholder or a literal control\n        placeholder.Controls.Add(new LiteralControl(htmlContent));\n    }\n\n    private string GenerateHtml(IEnumerable<string> items)\n    {\n        var sb = new StringBuilder();\n\n        sb.Append("<table>");\n        sb.Append("<tr><th>Item</th></tr>");\n\n        foreach (var item in items)\n        {\n            sb.Append("<tr>");\n            sb.AppendFormat("<td>{0}</td>", item);\n            sb.Append("</tr>");\n        }\n\n        sb.Append("</table>");\n\n        return sb.ToString();\n    }\n}